import Footer from "./Footer";
import Header from "./Header";
import App from "../App";
import "../css/intro.css";
import {Routes, Route} from 'react-router-dom';

const Intro = () =>{
return(
<div>
<Header />
<div class="main-img">이미지영역</div>
<Routes>
<div class="btn-group" role="group" aria-label="Basic mixed styles example">
  <Route path="/" element={<Intro />}><button type="button" class="btn btn-tutorial">튜토리얼</button></Route>
  <Route path="/" element={<App />}><button type="button" class="btn btn-start">시작하기</button></Route>
  <Route path="/" element={<Intro />}><button type="button" class="btn btn-metamask">메타마스크로 이동</button></Route>
</div>
</Routes>
<Footer />
</div>
)
}

export default Intro;
